import React, { Component } from 'react'


export default class App extends Component {
  render() {
    return (
      <div>
        <input type="checkbox">helo</input>
        <input type="checkbox">hey</input>
        <input type="checkbox">uncheck</input>
      </div>
    )
  }
}
